  07>' WILLIAMS, Evelyn Gillian (Jil1) m on 07.05.1941 to BARTON, Alan Roy Bidwill
  b 08.02.1919 d 17.12.1985
  b 16.02.1914 d 17.12.1981
  Gillian b. and m. at Gisborne and d. at Wellington. Alan, s/o Roy Barton and
  Florence Bidwill, b. at Featherston and d at Greytown..
  Jill was educated at Woodford House. After leaving school, she took her Trinity
  College Diploma in Speech and Drama and played a prominent part in many Gisborne
  Repertory Theatre productions. Later in life she continued her interest in drama
  a by helping to found the Greytown Little Theatre, where she produced and starred in
  several productions.
  Jill loved her garden and won prizes for her roses. She was active in Save the Children Fund, and many
  other community projects.
  Alan was educated at Croydon School (now Wellesley) and at Wanganui Collegiate School. He served in the
  Royal New Zealand Airforce during WW2, receiving the Distinguished Flying Cross, He completed two tours of
  duty as a bomber pilot flying missions over Germany. After the war he returned to "Ongaha" where he farmed
  until his retirement. He was for many years a director of the local building society.
  b1> BARTON, Alan John m on 07.11.1970 to NILSSON, Sally Vivianne
  b 22.03.1942
  b 13.09.1945
  John b. at Gisborne and m. at Havelock North. Sally, d/o Douglas Nilsson and Vivienne Bunny. Address:
  "Ongaha", RD 1, Featherston,
  John was educated at Huntley School and Wanganui Collegiate School then completed a Sheepfarming
  Diploma at Massey College. He is a farmer and company director.
  01> BARTON, Charles John
  b 24.08.1972
  Charles b. at Masterton, Charles was educated at Huntley School, Marton, and Wanganui Collegiate
  School then graduated BE(Hons) (Forestry) from the University of Canterbury.
  02> BARTON, Anna Louise
  b 29.07.1974
  Anna b. at Masterton. She was educated at Hadlow School, Masterton, St Matthew's School,
  Masterton, and Woodford House, Havelock North then graduated BA in Psychology from the University
  of Canterbury. She is now studying towards an MSc in Industrial/Organisational Psychology.
  03> BARTON, Caroline Bridget
  b 02.02.1979
  Caroline b. at Masterton. She was educated at Hadlow School, Masterton, St Matthew's School,
  Masterton, and Woodford House, Havelock North and is studying towards a BA and BCom at the
  University of Canterbury.
  02> BARTON, Belinda Mary m on 22.04.1982 to MAY, Anthony Stanley
  b 21.03.1947
  b 22.03.1944
  Belinda b. at Featherston and m. at Sydney, Australia. Anthony, s/o Henry Stevens May and Janet
  Pattullo, b, at Kent, England. Address: 144 Upland Road, Remuera, Auckland.
  Belinda was educated at Woodford House and lived in Sydney for 19 years, working in the theatrical and
  publishing industries before returning to Auckland in 1991.
  Tony was educated at Lancing College, Sussex, England. He is a company director.
